import React from 'react';
import { List, ListItem, ListItemText, Button } from '@mui/material';
import { getSavedForms } from '../utils/localStorage';
import { FormConfig } from '../types';

const FormList: React.FC<{ onSelect: (form: FormConfig) => void }> = ({ onSelect }) => {
    const [forms, setForms] = React.useState<FormConfig[]>([]);

    React.useEffect(() => {
        const savedForms = getSavedForms();
        setForms(savedForms);
    }, []);

    return (
        <div>
            <h2>Saved Forms</h2>
            <List>
                {forms.map((form, index) => (
                    <ListItem key={index} button onClick={() => onSelect(form)}>
                        <ListItemText primary={form.name} />
                    </ListItem>
                ))}
            </List>
            <Button variant="contained" color="primary" onClick={() => onSelect(null)}>
                Create New Form
            </Button>
        </div>
    );
};

export default FormList;
